import axios from 'axios';

const REPORT_API_BASE_URL = "http://localhost:8080/report";

class ReportService{

    getReports(){
        return axios.get(REPORT_API_BASE_URL+ "/view/all");
    }

    createReport(report){
        return axios.post(REPORT_API_BASE_URL+`/add/${report.adminId}`);

    }

    // updateReport(report){
    //     return axios.put(REPORT_API_BASE_URL, report);

    // }
    deleteReport(id){
        return axios.delete(REPORT_API_BASE_URL+ "/delete/" + id);

    }

    getReportById(report){
        return axios.get(REPORT_API_BASE_URL+ `/view/${report.reportId}`);
    }

}
export default new ReportService()
